import {Link} from "react-router-dom"
export default class Nav extends Component {
  render() {
    return (
      <div className="cs-Nav-x">
        <Link className="cs-Nav-button" to="/form1">Form1</Link>
        <Link className="cs-Nav-button" to="/form2">Form2</Link>
      </div>
    )
  }
}
